Nadine Velazquez (born November 20, 1978) is an American actress and model. Velazquez was born in Chicago, Illinois, of Puerto Rican descent. She attended the all-girls&amp;#039; Notre Dame High School for Girls, and has a BA in marketing. She appeared in the 2004 film Blast!, as well as the TV movie, The Last Ride, and currently stars in the NBC series My Name Is Earl as Catalina Aruca. She appeared on the January 2006 cover of Stuff, and was named #39 in the annual Maxim Hot 100 list. She was also originally cast as Fernando Sucre&amp;#039;s girlfriend Maricruz Delgado in the FOX series Prison Break but acquired a role in My Name Is Earl instead. She can be seen briefly on the Prison Break set in a featurette on the show&amp;#039;s first season DVD set.
